def getClusterServers(clustername):
  print('\nGet Servers from cluster: '+osbCluster)
  serverConfig()
  cluster = getMBean("/Clusters/" + osbCluster)
  if cluster is None:
    errorMsg= "Cluster " + clustername + " does not appear to exist!"
    print errorMsg
    raise(Exception(errorMsg))
  servers = cluster.getServers()
  return servers


def printStats(typeId, svrN="n/a", name="n/a", sCount="n/a", avg="n/a", min="n/a", max="n/a", tCount="n/a", eCount="n/a", fCount="n/a"):
  ts = strftime("%Y-%m-%d %H:%M:%S", gmtime())
  formatStr="%-20s %-12s %-4s %-8s %-8s %-8s %-12s %-14s %-12s %-12s %-30s"
  if typeId == "HEADER":
    print formatStr %("     Timestamp     ", "  SvrName","Type", "  Min   ", "   Avg  ", "  Max  ", "TotalCount", "SuccessCount", "ErrorCount", "FailureCount", "Service name")
    print formatStr %("-------------------", "----------","----", "--------", "--------", "--------", "------------", "--------------", "------------", "------------", "------------")
  else:
    print formatStr %(ts, svrN, typeId, min, avg, max, tCount,  sCount, eCount, fCount , name)

def getStatistics(typeId,svrN, serviceStats):
	for ps in serviceStats.entrySet():
		name=ps.getKey().getFullName()
		tCount =  fCount = eCount =0
		serviceStats = ps.getValue()
		try:
			resStatsArray = serviceStats.getAllResourceStatistics()
		except Exception, e:
			#printStats(name)
			pass
		if 'resStatsArray' in locals():
			for resStats in resStatsArray:
				statValues = resStats.getStatistics()
				for value in statValues:
					if value.getType().toString() == "COUNT" and value.getName() == "message-count" and value.getCount()>0:
						tCount=value.getCount()
					if value.getType().toString() == "COUNT" and value.getName() == "error-count" and value.getCount()>0:
						eCount=value.getCount()
					if value.getType().toString() == "COUNT" and value.getName() == "failure-rate" and value.getCount()>0:
						fCount=value.getCount()
					if value.getType().toString() == "INTERVAL" and value.getName() == "response-time" and value.getCount() >0:
						sCount=value.getCount()
						max=value.getMax()
						min=value.getMin()
						avg=value.getAverage()
					if value.getType().toString() == "INTERVAL" and value.getName() == "throttling-time" and value.getCount() >0:
						th_sCount=value.getCount()
						th_max=value.getMax()
						th_min=value.getMin()
						th_avg=value.getAverage()
		if 'th_sCount' in locals():
			printStats(typeId+"(T)", svrN, name, th_sCount, th_avg,  th_min, th_max, tCount, eCount, fCount)
		if 'sCount' in locals():
			printStats(typeId, svrN, name, sCount, avg,  min, max, tCount, eCount, fCount)


