        	typ="BS"
	elif typeId == "Pipeline":
        	typ="PP"
	if typeId in statsTypeList:
		e = sessionBean.getStatistics([ref], rs ,'')
		getStatistics(typ,'Cluster', e)

printStats("HEADER")
